  "geo" : { },
  "id_str" : "12204475021",
  "text" : "\uC544\uB0B4\uC640 \uC0AC\uADC0\uAE30 \uC2DC\uC791\uD558\uBA74\uC11C \uB09C \uAC8C\uC784\uC744 \uAC70\uC758 \uD558\uC9C0 \uC54A\uC558\uB2E4. \uC9C0\uB09C 2\uB144\uAC04 \uAC8C\uC784\uC744 \uD574 \uBCF8\uC801\uB3C4 \uC5C6\uB2E4. \uC6B0\uB9AC \uC9D1\uC5D0 \uC787\uB294 \uCEF4\uC740 \uC870\uB9BD\uD55C\uC9C0 4\uB144\uC774 \uB118\uC5B4 \uC624\uD53C\uC2A4\uB3C4 \uD798\uB4E4\uB2E4. \uD558\uC9C0\uB9CC \uB09C \uC544\uC9C1\uB3C4 \uAC8C\uC784\uB9CC \uBC14\uB77C\uBCF4\uBA74 \uAC00\uC2B4\uC774 \uB6F4\uB2E4.",
