  "geo" : { },
  "id_str" : "12204552636",
  "text" : "\uBC14\uB2F7\uAC00\uC5D0 \uC81C\uBC29\uC744 \uC313\uC73C\uBA74 \uD30C\uB3C4\uB294 \uADF8 \uC81C\uBC29\uC744 \uBD80\uC21C\uB2E4. \uADF8\uB7EC\uBA74 \uC778\uAC04\uC740 \uB354 \uD070 \uC81C\uBC29\uC744 \uC313\uB294\uB2E4. \uD558\uC9C0\uB9CC \uBC14\uB2E4\uB294 \uC5B4\uB5A4 \uC81C\uBC29\uC774\uB77C\uB3C4 \uBD80\uC220 \uC900\uBE44\uAC00 \uB418\uC5B4 \uC788\uB2E4. \uC870\uD654\uB85C\uC6B4 \uBC14\uB2F7\uAC00\uC5D0 \uC81C\uBC29\uC744 \uC313\uC74C\uC73C\uB85C\uC368 \uC77C\uC5B4\uB098\uB294 \uC774 \uC545\uBABD\uAC19\uC740 \uC7AC\uC559\uC740 \uC81C\uBC29\uC774 \uC5C6\uC5C8\uB2E4\uBA74 \uC77C\uC5B4\uB098\uC9C0 \uC54A\uC558\uC744 \uC7AC\uC559\uC774\uB2E4.",
