  "id_str" : "12204588025",
  "text" : "\uC5B4\uB5A4 \uC0AC\uAC74\uC774 \uC77C\uC5B4\uB098\uBA74 \uADDC\uC81C\uD558\uB294 \uAC01\uC885 \uBC95\uC548\uC774 \uB9CC\uB4E4\uC5B4\uC9C4\uB2E4. \uD558\uC9C0\uB9CC \uADF8 \uC5B4\uB5A4 \uBC95\uC548\uB3C4 \uC0AC\uAC74 \uC790\uCCB4\uAC00 \uC77C\uC5B4\uB098\uB294 \uAC83\uC744 \uB9C9\uC9C0 \uBABB\uD588\uACE0 \uC0C8\uB85C\uC6B4 \uC0AC\uAC74\uC744 \uD30C\uC0DD\uC2DC\uD0A4\uB294 \uBD80\uAC00\uC801\uC778 \uD6A8\uACFC\uB9CC\uC744 \uADF9\uB300\uD654\uC2DC\uCF30\uB2E4. \uC560\uCD08\uC5D0 \uADDC\uC81C \uBC95\uC548\uC774 \uC544\uB2CC \uADFC\uBCF8 \uC6D0\uC778\uC744 \uCC3E\uC558\uC5B4\uC57C \uD588\uB2E4.",
